import React from "react";
import Box from "./Box";

function Services() {
  return (
    <div is="services">
      <div className="s-heading">
        <h1>Services</h1>
        <p>Here are some Services of the App</p>
      </div>
      <div className="b-container">
        <Box />
      </div>
    </div>
  );
}

export default Services;
